INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 2, 1, 0, "春咲 ひより", 0, 1.4, 0, 1001, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1, "お！\nあそこに困ってそうな人発見！", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("みんなみたいに\nわたしも強くならなきゃ", 2, 1, 0, "草野 優衣", 0, 1.4, 0, 1002, "わ、わたし、\nなに言ってるんだろ\nあはは…", 1, "大切な人を\n守れるようになりたい…って", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("フェンシングを始めてみては？", 2, 1, 0, "士条 怜", 0, 1.4, 0, 1003, "少しは磨かれると思いますよ。", 1, "キミに必要な集中力と感性が", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("ねぇ、にいちゃん！", 2, 1, 0, "穂高 みそぎ", 0, 1.5, 0, 1004, "みそぎはねぇ、\nかくれんぼやりたい！", 1, "今日はなにして遊ぶ？", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("風宮あかりです", 2, 1, 0, "風宮 あかり", 0, 1.4, 0, 1006, "私といっしょに…\nいかない？", 1, "ねぇ…", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("出雲宮子なのー", 2, 1, 0, "出雲 宮子", 0, 1.5, 0, 1007, "食べ物の恨みは怖いのー", 1, "プリンたべたいのー", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("ボクは虹村雪。", 2, 1, 0, "虹村 雪", 0, 1.4, 0, 1008, "いいよ。\n見られることは運命さ…", 1, "キミもボクの美貌に\n吸い寄せられたんだね。", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("フッ…聞いて後悔するがいい！", 2, 1, 0, "柊杏奈", 0, 1.4, 0, 1009, "人呼んで「疾風の冥姫」!!", 1, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("マホマホ王国のプリンセス、\nまほ姫どす", 2, 1, 0, "姫宮 真歩", 0, 1.5, 0, 1010, "ほんまおおきにやわ～♪", 1, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("衣之咲璃乃です！", 2, 1, 0, "衣之咲 璃乃", 0, 1.4, 0, 1011, "ここで会ったが\n100年目～！", 1, "生き別れたお兄ちゃんを探して\n三千世界！", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("私はハツネ、\n結構強いんだよ。\nきらーん☆", 2, 1, 0, "柏崎 初音", 0, 1.4, 0, 1012, "…って、お願い！\n誰にも言わないでおいて～！", 1, "ち、超能力って…\n何のことかな～？", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("ちょす！\n美波鈴奈だよ～♪", 2, 1, 0, "美波 鈴奈", 0, 1.4, 0, 1016, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1, "一応カリスマ読モJKやってまっす！", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("はいたーい。\n喜屋武香織さー。", 2, 1, 0, "喜屋武 香織", 0, 1.4, 0, 1017, "でも、沖縄もとってもいいとこさー", 1, "東京は遊園地みたいなところさー", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("支倉伊緒です。", 2, 1, 0, "支倉 伊緒", 0, 1.4, 0, 1018, "イオちゃんって呼んでね。", 1, "先生って呼ばれるのは\nくすぐったいから", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 2, 1, 0, "茜 ミミ", 0, 1.5, 0, 1020, "ミミをおいてかないでぇ～", 1, "あ！/\お兄ちゃ～ん\nまってよ～", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("あ…あの…えっと…\n栗…林…くるみ…です……", 2, 1, 0, "栗林 くるみ", 0, 1.5, 0, 1021, "ふぇぇぇぇぇん……", 1, "あの……\nふぇ……", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("風宮よりです。\nあああああ！", 2, 1, 0, "風宮 より", 0, 1.4, 0, 1022, "なんてありがとうございます！", 1, "こんな私に貴重な時間を\n割いていただき、", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("私、アヤネ！\nぷうきちと一緒についてってあげるね！", 2, 1, 0, "北条 綾音", 0, 1.5, 0, 1023, "私こっち行きたいー\nね、早く早くー", 1, "おにいちゃんどこいくの？\nえ？", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("わっ…わっ…私、\n天野すずめといいます！", 2, 1, 0, "天野 すずめ", 0, 1.4, 0, 1025, "これて何か違う…\nあああすみません！", 1, "ふ、不束者ですが\nどうぞ末永く…って、", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("……クスクス…私は\n…倉石恵理子……", 2, 1, 0, "倉石 恵理子", 0, 1.4, 0, 1027, "離しませんわ………\n絶対に…!!", 1, "あなたは…運命の……\n伴侶……", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 2, 1, 0, "佐々木 咲恋", 0, 1.4, 0, 1028, "…そうでしょ？？", 1, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("桜井望だよ！\nよろしくねっ", 2, 1, 0, "桜井 望", 0, 1.4, 0, 1029, "あはは、\n私もまだまだだなぁ～", 1, "ぇっと…\nキミ、私のこと知らないの?!", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("デケデケデンっ！", 2, 1, 0, "ニノン・ジュベール", 0, 1.4, 0, 1030, "ショーグン、\nワタシと一緒に天下統一デース！", 1, "初めまして、\n私はニノン・ジュベール申すデス！", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("上喜しのぶです。\n手元のドクロが父です。", 2, 1, 0, "上喜 しのぶ", 0, 1.4, 0, 1031, "おかしいですね……", 1, "でもって私の隣にいるのが……\nえ、見えない？", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("目指すはビッグな\nお笑い芸人だっぺ！", 2, 1, 0, "野戸まひる", 0, 1.5, 0, 1033, "そう、\nオラのボケに突っ込める相方が…！", 1, "けんども\nそれには足りないモンが…", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 2, 1, 0, "綾瀬 ゆかり", 0, 1.4, 0, 1034, "ちょ\nちょっと一杯飲んできます…！", 1, "ちょっと緊張しちゃって…", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("氷川鏡華…です", 2, 1, 0, "氷川 鏡華", 0, 1.5, 0, 1036, "これ以上お話しすることは…\nないです！", 1, "知らない人とは話しちゃいけないので", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("柏崎…栞です。", 2, 1, 0, "柏崎 栞", 0, 1.4, 0, 1038, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1, "……あ、アラーム。", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("ふ、双葉碧です。", 2, 1, 0, "双葉 碧", 0, 1.4, 0, 1040, "野に咲く花が、\n唯一の話相手です。", 1, "私、一人も友達がいなくて……", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("三角千歌です。", 2, 1, 0, "三角 千歌", 0, 1.4, 0, 1042, "そう思っています。", 1, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("安芸真琴だ。", 2, 1, 0, "安芸 真琴", 0, 1.4, 0, 1043, "う、疑ってすまなかったな…", 1, "あぁ？\nお前のそいつの仲間か？", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("わらわこそは夜を総べる者！", 2, 1, 0, "イリヤ・オーンスタイン", 0, 1.4, 0, 1044, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1, "生けとし生ける全ての者よ！", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("そこで騎士は妖精を乱暴に……", 2, 1, 0, "遠見 空花", 0, 1.4, 0, 1045, "ｌク、クウカに何かご用ですか!?", 1, "ぐふふふふ……はっ！", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("宮坂たまきにゃ♪\n猫はいいにゃよ？", 2, 1, 0, "宮坂たまき", 0, 1.4, 0, 1046, "う～ん…\n猫ってホントに最高にゃ～♪", 1, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, 1, 0);
