INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("星野静流だよ！", 2, 1, 0, "星野静流", 0, 1.4, 0, 1049, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1, "クエストもバトルも\n掃除も洗濯も", 0, 1, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("アタシは玉泉美咲。", 2, 1, 0, "玉泉美咲", 0, 1.5, 0, 1050, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1, "見ての通りの\nセクシー美少女で", 0, 1, 0);
